INSERT INTO `iklans` VALUES ('3d3de712-658b-4430-9290-1dfdfb32bf23','Hallo Pelanggan PT JERNIH MULTI KOMUNIKASI','Terima kasih telah menjadi pelanggan setia kami selama lebih dari 6 bulan! Sebagai apresiasi atas kesetiaannya, kami ingin memberikan  paket tambahan sebesar 5-10mbps secara GRATIS!\r\n\r\nUpgrade paket ini berlaku bagi yang menginstall aplikasi sebelum tanggal 25 Desember. Aplikasi ini sama seperti WhatsApp, nantinya hanya digunakan untuk kirim bukti transfer dan otomatis membuat kuitansi. Kami lakukan upgrade sistem ini agar pelanggan mendapatkan kuitansi secara langsung.\r\n\r\nSebagai bonus, karena menginstal aplikasi, paket langganan  akan ditambahkan 10mbps. Jadi, jika  berlangganan 10mbps seharga 120 ribu, nantinya akan menjadi 15mbps dengan harga yang sama. Aplikasi ini berlaku mulai Januari 2026.\r\n\r\n*Penambahan kapasitas variatif antara 5-10 Mbps untuk wilayah Klaten & Boyolali, sedangkan untuk wilayah GK penambahan kapasitas 5mbps.\r\n\r\nTerima kasih atas kepercayaannya!!\r\n\r\nSupport IT','iklan/qyGIBzD8w6XmNP4HTWws6aCfiVIVvwkaa0JHtuTr.png','informasi',0,'active',NULL,'2fb18eb4-6d89-4d68-8bf4-3f51ef42e31c','2025-12-22 23:34:50','2025-12-22 23:34:50');
